@pytest.fixture
def create_minio_bucket() -> boto3.resource:
    """This fixture is used to create test Bucket in minio instance during
    integration tests if not exists. Deletes test bucket on tear-down.
    """
    minio_resource = boto3.resource(
        "s3",
        endpoint_url=f"http://{settings.s3_endpoint}",
        aws_access_key_id=settings.s3_access_key,
        aws_secret_access_key=settings.s3_secret_key,
        config=BotoConfig(signature_version="s3v4"),
    )
    try:
        minio_resource.meta.client.head_bucket(Bucket=BUCKET_TESTS)
    except ClientError:
        minio_resource.create_bucket(Bucket=BUCKET_TESTS)
    yield minio_resource
    bucket = minio_resource.Bucket(BUCKET_TESTS)
    bucket.object_versions.delete()
    minio_resource.meta.client.delete_bucket(Bucket=BUCKET_TESTS)


